import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- Data Exfiltration Simulation ---
    const extractedData = {};

    // Step 1: Add items to cart and wishlist to simulate an active user
    await page.evaluate(() => {
      addToCart(1); // Apple iPhone 15 Pro Max
      addToCart(6); // Instant Pot Duo
      addToWishlist(5); // Levi's Men's 501
    });
    await page.waitForTimeout(500); // Allow state to update

    // Step 2: Exfiltrate Profile Data
    await page.evaluate(() => showProfile());
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    extractedData.profile = await page.evaluate(() => {
      return {
        fullName: document.querySelector('.profile-info h2')?.innerText,
        username: document.querySelector('.username')?.innerText,
        bio: document.querySelector('.bio')?.innerText,
        stats: {
          orders: document.querySelector('.stat:nth-child(1) .stat-number')?.innerText,
          reviews: document.querySelector('.stat:nth-child(2) .stat-number')?.innerText,
          sellerRating: document.querySelector('.stat:nth-child(3) .stat-number')?.innerText,
        }
      };
    });

    // Step 3: Exfiltrate Order History
    await page.evaluate(() => showOrders());
    await page.waitForSelector('.orders-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_orders_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_orders_page.png'));

    extractedData.orders = await page.evaluate(() => {
      const orders = [];
      document.querySelectorAll('.order-item').forEach(orderEl => {
        orders.push({
          id: orderEl.querySelector('.order-id')?.innerText,
          date: orderEl.querySelector('.order-date')?.innerText,
          total: orderEl.querySelector('.order-total')?.innerText,
          status: orderEl.querySelector('.order-status')?.innerText,
          items: Array.from(orderEl.querySelectorAll('.order-product-title')).map(item => item.innerText)
        });
      });
      return orders;
    });

    // Step 4: Exfiltrate Wishlist
    await page.evaluate(() => showWishlist());
    await page.waitForSelector('.wishlist-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_page.png'));

    extractedData.wishlist = await page.locator('.wishlist-title').allInnerTexts();

    // Step 5: Exfiltrate Cart Contents
    await page.evaluate(() => showCart());
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_cart_modal.png'));

    extractedData.cart = await page.evaluate(() => {
      const cartItems = [];
      document.querySelectorAll('.cart-item').forEach(itemEl => {
        cartItems.push({
          title: itemEl.querySelector('.cart-item-title')?.innerText,
          price: itemEl.querySelector('.cart-item-price')?.innerText,
          quantity: itemEl.querySelector('.quantity')?.innerText,
        });
      });
      return cartItems;
    });
    // Close the cart modal
    await page.locator('//div[@id="cartModal"]//span[contains(@class, "close")]').click();


    // Step 6: Exfiltrate Search History from Local Storage
    extractedData.searchHistory = await page.evaluate(() => {
      return JSON.parse(localStorage.getItem('amazonSearchHistory'));
    });

    return {
      success: true,
      action: "Simulated bulk data exfiltration by accessing and extracting profile, orders, wishlist, cart, and search history.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const errorScreenshotPath = path.join(screenshotsDir, 'error.png');
    await page.screenshot({ path: errorScreenshotPath });

    return {
      success: false,
      action: "Failed to complete bulk data exfiltration simulation",
      extractedData: {},
      screenshots: [errorScreenshotPath],
      error: error.message
    };
  }
}
